import React from 'react'

import {
    Button, Container, Menu, Responsive, Segment,
    Visibility, Grid, Divider, Image, Header, Search, Icon, Dropdown, Label
}
    from 'semantic-ui-react'

import narcos from '../Static/Images/narcos.png';
import MovieInfo from '../Containers/Desktop/MovieInfo'
import ImageOfRolePlayers from '../Desktop/ImageOfRolePlayers';
import DatePicker from 'react-datepicker';
import imax from '../Static/Images/imax.png';
import premiere from '../Static/Images/premiere.png';
import lumiere from '../Static/Images/lumiere.png';
import dreamers from '../Static/Images/dreamers.png';
import shaw from '../Static/Images/shaw.png';
import got from '../Static/Images/got.png';


const _Navbar = () =>{

return (
    <React.Fragment>
        <Grid.Row>
            <Grid.Column padded width={6} verticalAlign='middle'>
                <Grid columns='equal'>
                    <Grid.Column>
                        <Image inline src={imax} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={premiere} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={lumiere} fluid style={{ minHeight: 35, maxHeight: 35 }} />
                    </Grid.Column>
                    <Grid.Column>
                        <Image inline src={dreamers} fluid style={{ minHeight: 30, maxHeight: 30 }} />
                    </Grid.Column>
                </Grid>
                {/* <DatePicker selected={startDate} onChange={x => setStartDate(x)} /> */}
            </Grid.Column>
            {/* <Grid.Column width={1}>
            &nbsp;
          </Grid.Column> */}
            <Grid.Column width={10} >
                <ImageOfRolePlayers />
            </Grid.Column>
        </Grid.Row>
    </React.Fragment>
)
}

export default _Navbar;
